import React from "react";
import Analytics from "./Analytics";

const AdminDashboard = () => {
  const data = {
    totalUsers: 120,
    totalProducts: 340,
    totalOrders: 85,
    totalRevenue: 150000000, // VND
  };

  return (
    <div>
      <h1>Trang Quản Trị</h1>
      <Analytics data={data} />
    </div>
  );
};

export default AdminDashboard;
